import React from "react";
import { OrganizarSemana } from "./OrganizarSemana";
import { Calendario } from "./style";


function Card(dias: any) {
  let domingo: any;
  domingo = OrganizarSemana(dias.dias.domingo);


  return (
    <>
      <Calendario>
        {domingo}
      </Calendario>
    </>
  );


}

export default Card;
